def check(n):
	a=n**5
	g=str(a)
	res=[]
	for i in g:
		if(g.count(i)>=1):
			res.append(i)
	res=set(res)
    # print(len(res))
	if(len(res)==10):
		return True
	else:
		return False


def nthwithproperty309(n):
	# Your code goes here
	found=0
	guess=308
	while(found<=n):
		guess+=1
		if(check(guess)):
			found+=1

	return guess
